- input: "TEXT\x1CC00380402\x1C.TEXT\x1C\x1CF3XA\x1CWe are amending this report in
    response to a letter received from the FEC dated July 11, 2008 and another dated
    September 5, 2008. We inadvertently reported a contribution to McConnell Senate
    Committee '08's  general that should have been reported as going to their primary.
    After speaking with the campaign,  we discovered that they reported it as it should
    have been; therefore, we are amending our report to accurately reflect this contribution.
    In our original amendment, we had entered a Memo Item that made the transaction
    unclear. We are correcting it with this amendment."
